### **Sudoku Rules**

- Each row must contain the digits 1 to 9 without repetition.
- Each column must contain the digits 1 to 9 without repetition.
- Each of the nine 3x3 subgrids (also called "boxes") must contain the digits 1 to 9 without repetition.

### **Sudoku Solver**

To check if a Sudoku puzzle has a unique solution, you can use a Sudoku solver. Here's an example of a Sudoku solver written in Python:

```python
def solve_sudoku(board):
    find_empty = find_empty_square(board)
    if not find_empty:
        return True
    else:
        row, col = find_empty

    for i in range(1, 10):
        if is_valid(board, i, (row, col)):
            board[row][col] = i

            if solve_sudoku(board):
                return True

            board[row][col] = 0

    return False

def is_valid(board, num, pos):
    # Check row
    for i in range(len(board[0])):
        if board[pos[0]][i] == num and pos[1] != i:
            return False

    # Check column
    for i in range(len(board)):
        if board[i][pos[1]] == num and pos[0] != i:
            return False

    # Check box
    box_x = pos[1] // 3
    box_y = pos[0] // 3

    for i in range(box_y*3, box_y*3 + 3):
        for j in range(box_x*3, box_x*3 + 3):
            if board[i][j] == num and (i, j) != pos:
                return False

    return True

def find_empty_square(board):
    for i in range(len(board)):
        for j in range(len(board[0])):
            if board[i][j] == 0:
                return (i, j)  # row, col

    return None

# Example usage
