### **Counting Word Occurrences in a Text File**

To count the number of occurrences of a specific word in a text file, you can use the following steps:

1. **Open the file** for reading.
2. **Read the file line by line**.
3. **Split each line into words** using a delimiter (e.g., space).
4. **Compare each word** with the target word.
5. **Increment a counter** for each match.
6. **Close the file** when done.

Here's a sample C++ program that demonstrates this process:

```cpp
#include <iostream>
#include <fstream>
#include <string>
#include <vector>

using namespace std;

int main() {
  // Target word to search for
  const string target_word = "hello";

  // Open the file for reading
  ifstream file("text_file.txt");

  // Check if the file opened successfully
  if (!file.is_open()) {
    cout << "Error opening file" << endl;
    return -1;
  }

  // Initialize a counter for word occurrences
  int word_count = 0;

  // Read the file line by line
  string line;
  while (getline(file, line)) {
    // Split the line into words
    vector<string> words;
    string word;
    istringstream iss(line);
    while (iss >> word) {
      words.push_back(word);
    }

    // Compare each word with the target word
    for (const string& word : words) {
      if (word == target_word) {
        word_count++;
      }
    }
  }

  // Close the file
  file.close();

  // Print the word count
  cout << "Word count: " << word_count << endl;

  return 0;
}
```

### **Explanation**

1. **Include necessary headers**: The program includes the `iostream`, `fstream`, `string`, and `vector` headers to read the file, manipulate strings, and store words in a vector.
2. **Define the target word**: The target word to search for is defined as a constant string.
3. **Open the file**: The file is opened for reading using the `ifstream` class.
4. **Check if the file opened successfully**: The program checks if the file opened successfully using the `is_open()` method.
5. **Initialize a counter**: An integer variable is used to count the number of occurrences of the target word.
6. **Read the file line by line**: The file is read line by line using the `getline()` function.
7. **Split each line into words**: Each line is split into words using the `istringstream` class and the `>>` operator.
8. **Compare each word with the target word**: Each word is compared with the target word using the `==` operator.
9. **Increment the counter**: If a match is found, the counter is incremented.
10. **Close the file**: The file is closed using the `close()` method.
11. **Print the word count**: The final word count is printed to the console.

### **Example Input**

Assume the following text file named `text_file.txt`:

```  
Hello, world!
Hello again!
Goodbye.
```

